DROP VIEW IF EXISTS `currency_delta`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `currency_delta` AS select `T1`.`currency_short_name` AS `currency`,ifnull((`T1`.`market_delta` - `T2`.`market_delta`),0) AS `delta` from (`currency_growth` `T1` left join `currency_falling` `T2` on((`T1`.`currency_short_name` = `T2`.`currency_short_name`))) ;

-- ----------------------------
-- View structure for currency_falling
-- ----------------------------
DROP VIEW IF EXISTS `currency_falling`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `currency_falling` AS select `c`.`currency_short_name` AS `currency_short_name`,`s`.`behavior` AS `behavior`,sum(`s`.`delta`) AS `market_delta` from ((`stock` `s` left join `markets` `m` on((`s`.`fk_market` = `m`.`id`))) left join `currencies` `c` on((`m`.`fk_currency` = `c`.`id`))) where (`s`.`behavior` = 'FALLING') group by `c`.`currency_short_name`,`s`.`behavior` ;

