CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `currency_growth` AS select `c`.`currency_short_name` AS `currency_short_name`,`s`.`behavior` AS `behavior`,sum(`s`.`delta`) AS `market_delta` from ((`stock` `s` left join `markets` `m` on((`s`.`fk_market` = `m`.`id`))) left join `currencies` `c` on((`m`.`fk_currency` = `c`.`id`))) where (`s`.`behavior` = 'GROWTH') group by `c`.`currency_short_name`,`s`.`behavior` ;
